import React from "react";
import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";
import "bootstrap/dist/css/bootstrap.min.css";
import AddPostit from "./components/add-postit";
import PostitsList from "./components/postits-list";

function App() {
  // const [user, setUser] = React.useState(null);
  return (
    <Router>
      <div>
        <nav className="navbar navbar-expand navbar-dark bg-dark">
          <a href="/" className="navbar-brand">
            POSTITS
          </a>
          <div className="navbar-nav mr-auto">
            <li className="nav-item">
              <Link to={"/postit"} className="nav-link">
                Create new Postit
              </Link>
            </li>
          </div>
        </nav>
      </div>

        <Switch>
          <Route exact path={["/", "/"]} component={PostitsList} />
          <Route path="/postit" render={(props) => <AddPostit {...props} />} />
        </Switch>

    </Router>
  );
}

export default App;
